import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import Accordion from 'react-bootstrap/Accordion';
import Axios from 'axios';

class WorkerToManager extends Component {
  constructor(props) {
    super(props);
    this.state = {
      columns: [{ "header": "ID", "name": "uniqueId" },
      { "header": "ResourceManager", "name": "resourceManagerId" },
      { "header": "Client", "name": "client" }],
      showWorkerToManager: true,
      showAdd: false,
      showUpdate: false,
      showDelete: false,
      showWorker: false,
      showRM: false,
      id: null,
      resourceManagerId: null,
      workerId: null
    }
    this.handleAdd = this.handleAdd.bind(this);
    this.handleUpdate = this.handleUpdate.bind(this);
    this.handleDelete = this.handleDelete.bind(this);
    this.handleClose = this.handleClose.bind(this);
    this.handleBack = this.handleBack.bind(this);
    this.handleSubmitAdd = this.handleSubmitAdd.bind(this);
    this.handleSubmitUpdate = this.handleSubmitUpdate.bind(this);
  }

  handleSubmitAdd(event) {
    event.preventDefault();
    console.log("Form Add submitted"); 
    if (this.state.resourceManagerId) {
      let userData = {
        resourceManagerId: this.state.resourceManagerId,
      }
      debugger
      Axios({
        url: 'http://localhost:9091/worker_to_manager/', 
        method: "post",
        data: userData,
        headers: {
          'Content-Type': 'application/json'
        }
      }).then(res => {//help on understanding these few lines
        debugger
        console.log(this.props);
      }).catch(err => {
        console.log(err);
      })
    }

    this.setState({//hides the modal
      id: null,
      resourceManagerId: null,
      workerId: null,
      showAdd: false,
      showDelete: false,
      showUpdate: false,
      showWorkerToManager: true,
      showWorker: false
    })
  }

  handleSubmitUpdate(event) {
    event.preventDefault();
    console.log("Form Update submitted");
    if (this.state.resourceManagerId) {
      let userData = {
        id: this.state.id,
        workerId: this.state.workerId,
        resourceManagerId: this.state.resourceManagerId,
      }
      debugger
      Axios({ //when updating information
        url: 'http://localhost:9091/worker_to_manager/' + this.state.id, //this.state.id= value /{id}
        method: "put",
        data: userData,
        headers: {
          'Content-Type': 'application/json'
        }

      }).then(res => {
        debugger
        console.log(this.props);
      }).catch(err => {
        console.log(err);
      })
    }
    this.setState({
      id: null,
      resourceManagerId: null,
      workerId: null,
      showAdd: false,
      showDelete: false,
      showUpdate: false,
      showWorkerToManager: true,
      showWorker: false  
    })
  }

  handleSubmitDelete(event) {//deleteing data
    // event.preventDefault();
    console.log("Form Delete submitted");
    debugger
    if (this.state.id) {
      Axios({
        url: 'http://localhost:9091/worker_to_manager/' + this.state.id,
        method: "delete",
        data: "",
        headers: {
          'Content-Type': 'application/json'
        }

      }).then(res => {
        event.preventDefault();
        debugger
        console.log(this.props);
      }).catch(err => {
        console.log(err);
      })
    }
    this.setState({
      id: null,
      resourceManagerId: null,
      workerId: null,
      showAdd: false,
      showDelete: false,
      showUpdate: false,
      showWorkerToManager: true,
      showWorker: false
    })
  }

  handleAdd(event) {//help with this line of code
    this.setState({
      showAdd: true,
      showDelete: false,
      showUpdate: false,
      showWorkerToManager: false,
      showWorker: false
    })
  }

  handleUpdate = (id) => {
    debugger;
    this.setState({
      id: this.props.rows[id].uniqueId,
      resourceManagerId: this.props.rows[id].resourceManagerId,
      workerId: this.props.rows[id].workerId,
      showUpdate: true,
      showAdd: false,
      showDelete: false,
      showWorkerToManager: false
    })
  }

  handleDelete(id) {
    this.setState({
      id: this.props.rows[id].uniqueId,
      showDelete: true,
      showAdd: false,
      showUpdate: false,
      showWorkerToManager: false
    })
  }

  handleClose(event) {
    this.setState({
      showUpdate: false,
      showDelete: false,
      showAdd: false,
      showWorker: false,
      showWorkerToManager: true     
    })
  }

  handleBack(event) {
    this.setState({
      showUpdate: false,
      showDelete: false,
      showAdd: false,
      showWorker: true,
      showWorkerToManager: false    
    })
  }

  handleOnChange = (event) => {
    debugger
    let obj = {}

    obj[event.target.id] = event.target.value;

    this.setState({

        ...this.state.id,

        ...this.state.resourceManagerId,

        ...obj


    })

    console.log("onchange =? obj => ", obj)
    console.log('this.state => ', this.state)

  }

  render() {
    console.log("props--------", this.props);
    console.log("line 314", this.state);
    return (
      <div>
        <table>
          <thead>
            <tr>
              {this.state.columns.map(col =>
                <th key={col.resourceManagerId}>{col.header}</th>
              )}
            </tr>
          </thead>
              <tbody>
                {this.props.rows.map((row, index)  =>
                  <tr>
                    {this.state.columns.map(col =>
                      <td key={col.resourceManagerId}>{row[col.resourceManagerId]}</td>
                    )}
                    <Button variant="primary" onClick={() => { this.handleUpdate(index) }} > update </Button>
                    <Button variant="primary" onClick={() => { this.handleDelete(index) }} > delete </Button>
                  </tr>
                )}
              </tbody>
        </table>
        <Button variant="inherit" onClick={this.handleAdd}>
          Add
        </Button>
        <Button variant="inherit" onClick={this.handleBack}>
          Back
        </Button>

        <Modal show={this.state.showUpdate} onHide={this.handleClose}>
          <Modal.Header>
            <Modal.Title>Update WorkerToManager</Modal.Title>
          </Modal.Header>
          <form onSubmit={this.handleSubmitUpdate}>
            <Modal.Body>
              <br />
              <label For="id">ID</label>
              <br/>
              <label For="id" >{this.state.id}</label>
              <br/>
              <label For="resourceManagerId">resourceManagerId</label>
              <input id="resourceManagerId" name="resourceManagerId" type="text" onChange={this.handleOnChange} value={this.state.resourceManagerId} />
              <label For="workerId">workerId</label>
              <input id="workerId" name="workerId" type="text" onChange={this.handleOnChange} value={this.state.workerId} />
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={this.handleClose}>
                Close
                </Button>
              <Button type="submit" variant="primary" >
                Submit
                </Button>
            </Modal.Footer>
          </form>
        </Modal>


        <Modal show={this.state.showDelete} onHide={this.handleClose}>
          <Modal.Header>
            <Modal.Title>Delete New Worker</Modal.Title>
          </Modal.Header>
          <form onSubmit={this.handleSubmitDelete}>
            <Modal.Body>
              <label For="ID">ID</label>
              <input id="ID" type="text" onChange={this.handleOnChange} value={this.state.id} />
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={this.handleClose}>
                Close
                </Button>
              <Button type="submit" variant="primary" >
                Submit
                </Button>
            </Modal.Footer>
          </form>
        </Modal>

        <Modal show={this.state.showAdd} onHide={this.handleClose}>
          <Modal.Header>
            <Modal.Title>Add Worker</Modal.Title>
          </Modal.Header>
          <form onSubmit={this.handleSubmitAdd}>
            <Modal.Body>
              <label For="resourceManagerId">resourceManagerId</label>
              <input id="resourceManagerId" name="resourceManagerId" type="text" onChange={this.handleOnChange} value={this.state.resourceManagerId} />
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={this.handleClose}>
                Close
                </Button>
              <Button type="submit" variant="primary" >
                Submit
                </Button>
            </Modal.Footer>
          </form>
        </Modal>

        {/* <Modal show={this.state.showWorkerToManager} onHide={this.handleClose}>
          <Modal.Header>
            <Modal.Title>Worker's Records</Modal.Title>
          </Modal.Header>
          <Modal.Body>
            <WorkerToManager rows={this.state.data}/>
          </Modal.Body>
          <Modal.Footer>
            <Button variant="primary" onClick={this.handleClose}>
              Close
            </Button>
          </Modal.Footer>
        </Modal> */}

      </div>);
  }
}

export default WorkerToManager;
